Weiter biegt die Grenze um, dem Meere zu, südlich von dem Berge, der südlich von Bethhoron liegt, und läuft nach Kariathbaal aus, welches auch Kariathiarim heißt, einer Stadt der Söhne Judas. Dies ist die Seite gegen das Meer zu, nach Westen.
Die Südgrenze aber geht von Kariathiarim aus gegen das Meer, und reicht bis zur der Wasserquelle von Nephtoa;
sodann geht sie herab auf einen Teil des Gebirges, welches vor dem Tale der Söhne Ennoms liegt, nördlich an dem äußersten Teile des Tales Raphaim; und zieht sich nach Geennom (das ist in das Tal Ennom) an der Südseite der Jebusiter hinab, bis sie zur Quelle Rogel kommt.
